import App from "./App";
import Login from "./Login/Login";
import { BrowserRouter, Route, Switch } from 'react-router-dom';
function Rotas() {
    return (
        <BrowserRouter>
        <Switch></Switch>
                <Route exact path="/" component={App} />
                <Route path="/login" component={Login} />
        </BrowserRouter>
    )
}

export default Rotas
